import React, {useState} from 'react';
import App from './App';

const Demo = () => {
    const [people, setPeople] = useState([
        {
            firstName: 'John',
            lastName: 'Doe'
        }, 
        {
            firstName: 'Joey',
            lastName: 'Wang'
        }
    ])
    return (
        <div className="container">
            <h1>Hello World. Im a demo page</h1>
        </div>
    )
}

export default Demo;
